import React from 'react';
import axios from 'axios';


class Index extends React.Component {

    state = {
        access_token : ''
    }

    componentDidMount() {
        this.setState({ access_token: this.itemToBeConsumed() });
    }

    render() {
        return <a href="https://api.instagram.com/oauth/authorize?client_id=832162937288585&redirect_uri=https://8d083a5d.ngrok.io/&scope=user_profile,user_media&response_type=code"><span>Login with Instagram</span></a>;
    }
}

export default Index;
